import React from "react";

const NavBar = props => {
    return (
        <div className="ui menu">
            <div className="header item">
                Shop name
            </div>
            <div class="item">
                <div class="ui button">
                    <i className="shop icon" test="icon-image" />
                </div>
            </div>
        </div>

    );
};

export default NavBar;
